            const res = await fetch(
                `https://api.nasa.gov/planetary/apod?api_key=ESK4QjzOX9TTD21xNAWgBHDFU2FsOkf8vVhYMFla`
            )
            const data = await res.json()
            setPhotoData(data)
            console.log(data)
        }
    }, [])

    if (!photoData) return <div />

    return (
        <div>
            <img
                src={photoData.url}
                alt={photoData.title}
                />
        </div>
    )
}
